INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node',	'producto',	0,	1,	1,	'und',	0,	'Nuevas Chip’s Chipotle Limón, están preparadas artesanalmente con los ingredientes más selectos para que en cada mordida saborees el arte de hacer papas. ¡No te quedes sin probar nuestra nueva creación! no\r\n',	'',	'filtered_html'),
('node',	'producto',	0,	2,	2,	'und',	0,	'Hacer las Chip’s Jalapeño es todo un arte y nosotros sabemos cómo hacerlo. La selección de los mejores jalapeños combinan perfectamente con el delicioso sabor natural de nuestras papas, logrando un crunch que se vuelve irresistible al paladar.',	'',	'filtered_html'),
('node',	'producto',	0,	3,	3,	'und',	0,	'Chip’s Sal de Mar son un sabor inigualable que nos encanta. Las papas artesanales, crujientes y deliciosas por excelencia que preparamos cuidadosamente con los ingredientes más naturales para conservar nuestro auténtico sabor a papa que te cautivará en cada mordida.',	'',	'filtered_html'),
('node',	'producto',	0,	4,	4,	'und',	0,	'Chip’s Adobadas. Nos encanta elegir las mejores papas y usar nuestro proceso artesanal para lograr ese tradicional sabor a papa con textura súper crujiente y el nivel ideal de picorcito que las convierte en una de nuestras opciones más irresistibles. ',	'',	'filtered_html'),
('node',	'producto',	0,	5,	5,	'und',	0,	'El arte de hacer papas es el secreto de nuestra cocina que ha pasado de generación en generación. En las Chip’s a la Diabla cuidamos hasta el mínimo detalle en la preparación para capturar esos sabores atrevidos en cada MORDIDA.',	'',	'filtered_html'),
('node',	'producto',	0,	6,	6,	'und',	0,	'El CRUJIENTE sabor de Chip’s, con un toque de limón para los amantes de lo acidito. La calidad de los ingredientes que seleccionamos y el sazón tradicional de nuestra cocina crean el balance ideal QUE TE HACE AGUA LA BOCA',	'',	'filtered_html'),
('node',	'producto',	0,	7,	7,	'und',	0,	'Le ponemos candela al sabor con Chip’s Fuego. La preparación más ardiente de picante y especias para encender tus crujientes papas. Esto es posible GRACIAS A QUE mantenemos estrictos estándares de calidad en alimentos Y AL sazón maestro de nuestra cocina.',	'',	'filtered_html'),
('node',	'producto',	0,	9,	9,	'und',	0,	'hola mike',	'',	'filtered_html'),
('node',	'historias',	0,	10,	10,	'und',	0,	'Historia 1',	'',	'filtered_html'),
('node',	'historias',	0,	11,	11,	'und',	0,	'Historia 2',	'',	'filtered_html'),
('node',	'historias',	0,	12,	12,	'und',	0,	'Historia 3',	'',	'filtered_html'),
('node',	'historias',	0,	13,	13,	'und',	0,	'Historia 4',	'',	'filtered_html'),
('node',	'historias',	0,	14,	14,	'und',	0,	'Historia 5',	'',	'filtered_html'),
('node',	'page',	0,	15,	15,	'und',	0,	'Usted como usuario, al utilizar éste Sitio Web, acepta los términos y condiciones, que a continuación se mencionan:<br />\r\nCualquier uso del material contenido en este sitio web por el usuario \"usted\" será utilizado bajo su propio riesgo.<br />\r\nGrupo Bimbo S.A.B de C.V. o cualquier de sus afiliadas o subsidiarias \"Grupo Bimbo\" no será responsable si la información disponible en este sitio web no es precisa o completa.<br />\r\nTransmisión<br />\r\nCualquier información que usted transmita o coloque en este sitio web no será considerada como confidencial y se convierte en propiedad de Grupo Bimboy la podrá utilizar para cualquier propósito, incluso para el desarrollo, fabricación, publicación y mercadeo de productos. Cualquier tipo de uso no generará compensación alguna. Usted declara que es el titular o licenciatario delcontenido, que de ninguna manera viola derechos de terceros.<br />\r\nPropiedad Intelectual<br />\r\nA reserva de sus Datos Personales, cualquier información, textos, imágenes, que sea introducida por usted en los espacios disponibles al público en general, será propiedad de Grupo Bimbo, por lo que éste podrá utilizarla, reproducirla, modificarla, adaptarla o ponerla a disposición del público, además de estar facultado para utilizar los comentarios, ideas, sugerencias o cualquier información que usted introduzca a este sitio, sin que esto genere alguna compensación.<br />\r\nPor otro lado, Grupo Bimbose reserva el derecho a evitar que se publiquen fotos, gráficos, material sonoro o de video que usted introduzca en los espacios disponibles al público en general, que éste sean ilegales, inmorales, o bien, que vayan en contra de sus políticas.<br />\r\nNinguna reproducción de cualquier parte del sitio web puede ser vendida o distribuida con fines de lucro ni debe ser modificada o incorporada en cualquier otro medio.<br />\r\nLas marcas, diseños, personajes, caracteres y marcaspublicadas en el Sitio Web pertenecen a Grupo Bimbo. Ningún contenido de este sitio web debe interpretarse como un otorgamiento de licencia de uso o derecho de uso de cualquier Marca mostrada en este sitio web. Por el acceso a este sitio web, usted se compromete a no reproducir ni utilizar ningún derecho de propiedad industrial e intelectual propiedad de Grupo Bimbosin su autorización. Grupo Bimbohará uso de las acciones legales correspondientes en caso de que se haga un uso ilegal de sus derechos de propiedad industrial e intelectual incluyendo acciones penales, civiles y administrativas.<br />\r\nEnlaces a otros sitios web<br />\r\nLos enlaces en los sitios web de Grupo Bimbo pueden dirigirlo a websites diferentes al de Grupo Bimbo, por lo cual Grupo Bimbo no acepta responsabilidad alguna respecto del contenido, precisión o función del contenido de estos otros sitios web.<br />\r\nGarantías<br />\r\nGrupo Bimbo no otorga garantías de ningún tipo, ni de manera expresa, implícitas, legales, ni de ningún otro tipo, (incluyendo garantías implícitas de comercio y fitness para cualquier propósito) así como tampoco garantías o representaciones que el material en este sitio web esté completo, preciso, puntual y que no infringe derechos de terceros; que el servicio de este sitio web será ininterrumpido o libre de errores y seguro; que cualquier consejo u opinión de Grupo Bimbo a través de este sitio web es preciso o confiable.Grupo Bimbo por medio de éste documento expresamente renuncia a cualquier garantía. En algunas jurisdicciones no se permiten las exclusiones de responsabilidad implícita, por lo que usted deberá verificar si éstas son aplicables a usted.<br />\r\nRenuncia de responsabilidades<br />\r\nNi Grupo Bimbo ni ninguna otra parte involucrada en crear, producir o manejar este sitio en nuestro nombre tendrá responsabilidad alguna por cualquier: uso directo, accidental, consecuente, indirecto, daños, gastos, pérdidas o responsabilidad por su acceso a usar, inhabilitar el uso, cambiar el contenido de este sitio o que surjan por cualquier otro acceso al sitio web a través de un enlace de este sitio web o de cualquier acción que tomemos o decidamos no tomar como resultado de cualquier correo electrónico que nos envíen.<br />\r\nCualquier material contenido en este sitio web está sujeto a cambio sin previo aviso. Adicionalmente, Grupo Bimbo no tendrá responsabilidad alguna por cualquier pérdida causada por virus que puedan infectar a su computadora u otra propiedad por razón de usar, ingresar o bajar cualquier material de este sitio web. Si usted elige bajar materiales de este sitio web siempre será bajo su propio riesgo.<br />\r\nActividades Prohibidas<br />\r\nSe encuentra estrictamente prohibido cometer cualquier acto que a consideración de Grupo Bimbo, sea considerado como inapropiado o ilegal incluyendo de manera ilimitada:<br />\r\n- Cualquier acto que pueda constituir una infracción a la privacidad (incluyendo subir información privada sin el consentimiento del dueño de la misma) o cualquier otro que forme parte de los derechos legales de los individuos; - Usar este sitio web para difamar o calumniar a Grupo Bimbo, sus colaboradores o cualquier otro tercero, así como actuar de forma tal que se vea perjudicado Grupo Bimbo; - Subir archivos que contengan virus que pueden causar daño a la propiedad de Grupo Bimbo o la propiedad de otros individuos.<br />\r\nGRUPO BIMBO se reserva el derecho de restringir o dar por terminado el ingreso a este sitio web en cualquier momento.<br />\r\nLegislación y Tribunales<br />\r\nUsted y Grupo Bimbo acuerdan que cualquier controversia o reclamo que surja del uso de este sitio web debe ser reglamentado por México Distrito Federal y debe ser sometido a la exclusiva jurisdicción de los tribunales de México Distrito Federal.<br />\r\nActualización de los Términos y Condiciones<br />\r\nNos reservamos el derecho de hacer cualquier cambio o corrección a este aviso\r\n',	'',	'full_html');
